  return (
    <div className="App">
      <header className="App-header">
        <section>
          <Image
            width={200}
            src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
          />
        </section>      
      </header>
    </div>
  );
}

export default App;
